export const menuContent = {
  title: "Categories",
  categories: [
    { name: "Category name 1", quantity: 320 },
    { name: "Category name 2", quantity: 112 },
    { name: "Category name 3", quantity: 32 },
    { name: "Category name 4", quantity: 48 },
  ],
};

export const brands = [
  { label: "Mimi", id: "idMimi" },
  { label: "Momo", id: "idMomo" },
  { label: "Mumu", id: "idMumu" },
  { label: "Meme", id: "idMeme" },
  { label: "Mama", id: "idMama" },
];
